import React, { Component } from 'react'
import {InfoConsumer} from '../Context';
import Info from '../Info';

function Home(){
    return (
        <div className="container">
            <div className="row mt-5">
            <InfoConsumer>
            {
                value => {
                return <h2>{value.info.map(item =>{item.id})}</h2>
                }
            }
        </InfoConsumer>
            </div>
        </div>
        );
}
export default Home;
